function GamingLibraryCard(props) {
  return (
    <div className='gaming-library-card'>
    <ul>
        <li><img src={props.image}/></li>
        <li><h4>{props.titl}</h4></li>
    </ul>

    </div>
  )
}

export default GamingLibraryCard
